css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

/* blue fix */
div.search_form_row {background-color: rgba(50,0,0,0.5)}
div.l-header .selection_nipple {border-bottom-color: rgba(50,0,0,0.5)}

#left_column, #right_column {
	background-color: transparent;
}
.controls_section.user_list li.item .follow_list_item_blog:before {
  background-image: none;
  border-right: none;
  }
.radar div.radar_footer .radar_avatar:before {
  background-image: none;
  }
#right_column:after {display:none}

.blog.has_follow_button:before,
#right_column:after {display: none}

BODY:not(.mceContentBody), #new_post.editing {
  background: linear-gradient(to bottom, magenta, magenta 3px, transparent 3px, transparent) center right,
     linear-gradient(to right, magenta, magenta 3px, transparent 3px, transparent) center right,
    url('data:image/png;base64,')
    center right repeat fixed
    rgb(199,225,158) !important;
  background-size: 160px 160px !important;  
}
#new_post.editing {background-attachment: scroll !important}
/*.post_form_wrapper {background-color: rgba(50,50,50,0.6)}*/
.new_post .title, .new_post .tag_editor {
  background-color: rgba(255,255,255,1) !important;
}

.posts .post_content blockquote,
.mceContentBody blockquote {
  margin-left: 0 !important;
  margin-right: 0 !important;
  padding-left: 10px !important;
  border-width: 4px !important;
  border-color: #d5b1b8 !important;
}

.posts .post_content blockquote > blockquote,
.mceContentBody blockquote > blockquote {
  border-color: #b68d96 !important;
}

.posts .post_content blockquote > blockquote > blockquote,
.mceContentBody blockquote > blockquote > blockquote {
  border-color: #947379 !important;
}

.posts .post_content blockquote > blockquote > blockquote > blockquote,
.mceContentBody blockquote > blockquote > blockquote > blockquote {
  border-color: #74545a !important;
}

.posts .post_content blockquote > blockquote > blockquote > blockquote > blockquote,
.mceContentBody blockquote > blockquote > blockquote > blockquote > blockquote {
  border-color: #533c40 !important;
}

#left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {
  background: rgba(50,0,0,0.5) !important;
}

